def minion_game(string):
    VOWELS = "aeiou"

    def consonats_words(word: str) -> list:
        consonant_combinations = []
        for index, letter in enumerate(word):
            temp = ""
            if letter in VOWELS:
                continue
            for next_index in range(index, len(word)):
                temp += word[next_index]
                if temp not in consonant_combinations:
                    consonant_combinations.append(temp)
        dict_of_values = {word: 0 for word in set(consonant_combinations)}
        for word in consonant_combinations:
            dict_of_values[word] += 1
        return sum([x for x in dict_of_values.values()])

    def vowels_words(word: str) -> list:
        vowels_combinations = []
        for index, letter in enumerate(word):
            temp = ""
            if letter in VOWELS:
                for next_index in range(index, len(word)):
                    temp += word[next_index]
                    if temp not in vowels_combinations:
                        vowels_combinations.append(temp)
        dict_of_values = {word: 0 for word in set(vowels_combinations)}
        for word in vowels_combinations:
            dict_of_values[word] += 1
        return sum([x for x in dict_of_values.values()])

    stuart = consonats_words(string.lower())
    kevin = vowels_words(string.lower())

    str_ = ""

    if stuart > kevin:
        str_ += f"Stuart {stuart}"
    else:
        str_ += f"Kevin {kevin}"

    print(str_)


if __name__ == "__main__":
    s = ""
    minion_game(s)
